import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Adminhome from "./Adminhome";
import AdminRegister from "./AdminResister"; // Fixed spelling (Resister -> Register)
import Adminlogin from "./Adminlogin";
import Admingmail from "./Admingmail";
import Adminpassword from "./Adminpassword";

export default function App() {
  return (
    <Router>
      <div>
        <Routes>
          {/* Set AdminRegister as the default route */}
          <Route path="/" element={<AdminRegister />} /> {/* Default route */}
          <Route path="/login" element={<Adminlogin />} />
          <Route path="/home" element={<Adminhome />} />
          <Route path="/gmail" element={<Admingmail />} />
          <Route path="/password" element={<Adminpassword />} />
        </Routes>
      </div>
    </Router>
  );
}
